// JavaScript Document
import React from 'react';
//import StateActivities from '../pages/stateActivities';

//Material UI
import Link from '@material-ui/core/Link';
import Grid from "@material-ui/core/Grid";

const id ='FL';
const endpoint = `stateCode=${id}&limit=2`;

//Smart Component
class StateParks extends React.Component {
	//declaring state and new object
	state ={
		parkListing: [],
	}

//calling fetchData function
	componentDidMount(){
	this.fetchParks();
}

//fetching API
 fetchParks(){
	fetch(`https://developer.nps.gov/api/v1/parks?${endpoint}&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq`)
		.then(results =>{
		return results.json();
	}).then(data =>{

		let mList = data.data.map((use, i)=>{
			return(
      	<Link color="inherit" href="/">
		<img src={use.images[0].url} alt={use.images[0].altText} style={{width: '50%'}}/>
				</Link>
			)
		})

		this.setState({StateParks:mList});
	})
} 
	 render() { 
  return (
	  <Grid container style={styles.container}>
	  <Grid item xs={12} md={6}  style={styles.links}>
	  <Link />
	  </Grid>
	   <Grid item xs={12} md={6} style={styles.links}>
	  <Link />
	   </Grid>
	  {this.state.StateParks}			
	  </Grid>
  );
 }
}
export default StateParks
const styles ={
container:{
columns:'2 auto',
},
links:{
border:'1px solid red',
},
}
